【イハダ アレルスクリーンジェル ピュアオレンジの香りの詳細】<br>
●鼻や目のまわりに塗るだけで、花粉、PM2.5を寄せ付けない。<br>
●特許技術の成分が、花粉を反発・吸着防止。<br>
●ファンデーションの上に使いやすい透明さらさらジェル。<br>
●精油配合。<br>
●皮膚アレルギーテスト済み。（すべての方に皮膚刺激やアレルギーが起きないというわけではありません。）<br><br>

【使用方法】<br>
●鼻に使う場合<br>
1.ジェルを1滴（ゴマ粒大）人差し指にとります。<br>
2.鼻孔の周りを中心に、ジェルの薄い膜を作るように塗ります。<br>
3.空気中の花粉、PM2.5を反発し、吸着を防ぎます。<br>
●目のまわりに使う場合<br>
1.ジェルを1滴（ゴマ粒大）人差し指にとります。<br>
2.片方ずつ目を閉じて上と下のまぶたにジェルの薄い膜を作るように塗ります。<br>
3.空気中の花粉、PM2.5を反発し、吸着を防ぎます。<br><br>

【ご注意】<br>
○乳幼児の手の届かないところにおいてください。<br>
○パッケージ台紙裏面の説明文をよく読んでからご使用ください。<br>
○日のあたるところや高温のところに置かないでください。<br>
○目に入った場合は、すぐに水またはぬるま湯で洗い流してください。<br>
○アルコールやメントールなどの清涼感に敏感な方はご注意ください。<br><br>

【成分】<br>
水、エタノール、AMPD、ポリクオタニウム-51、(PEG-240/デシルテトラデセス-20/HD1)コポリマー、カルボマー、PPG-13デシルテトラデセス-24、オレンジ油、BHT、トコフェロール、フェノキシエタノール、香料<br><br>

【内容量】<br>
3g<br><br>

【販売元】<br>
資生堂薬品<br>
東京都港区東新橋 1-1-16<br>
お問い合わせ先：03-3573-6673<br><br>

【商品区分】<br>
衛生医療<br><br>

[IHADA 顔の肌トラブル治療薬/花粉吸着防止ジェル]

