「バンドエイド」肌色タイプ<br>
<br>
◎はがれにくい<br>
◎貼り心地がよく<br>
◎目立ちにくい<br>
<hr>
ワイドサイズ× 20枚<br>
<br>
・スタンダードサイズより10幅の広いゆとりのサイズ。<br>
・ちょっと大きめのキズに最適です。<br>
<br>
テープサイズ：68mm×29mm<br>
パッドサイズ：29mm×21mm<br>

<hr>
粘着力が強いので、水の中でもはがれにくい。<br>
傷口につきにくい特殊加工パッドですから、はがす時に痛くありません。<br>
しなやかで通気性の良い、目立たない肌色のテープです。<br>
お肌にやさしい低アレルギー性粘着材を使用しています。<br>
しかも、すべてのバンドエイドは滅菌済です。<br>
<br>
■はがれにくく快適！　「オーバル形」を採用<br>
<br>
救急ばんそうこうの究極の「快適さ」を追求した結果生まれた、角が丸くなったユニークなカタチ<br>
<br>
◎貼り心地がよく、端からはがれにくい、オーバル形。<br>
<br>
・オーバル形は目新しいだけではなく優れた機能を持っています。<br>
・パッド部分においてはストレスが分散するため、創傷部分にやさしく、指の曲げ伸ばしもスムーズに。<br>
・さらにテープの端を丸くすることによって、ひっかかりにくくはがれにくくなります。<br>
<br>
■伸縮性がさらにアップ！貼り心地のよい新素材を開発<br>
<br>
製品のテープ素材を（性質の異なるフィルムを重ねた）積層構造に変更することによって、<br>
伸縮性が高く、肌触りの良い素材の開発に成功しました。<br>
<br>
■日本人の肌色を追求！より目立ちにくい色を採用<br>
<br>
より日本人の色に目立ちにくい色を採用。<br>
既存のテープに比べて、多くの方が「目立ちにくい」と答えています。<br><br>医療用具承認番号：07BZ0032(一般医療機器)<br>
<br>
【お問い合わせ先】<br>
ジョンソン・エンド・ジョンソン株式会社<br>
コンシューマー カンパニー　お客様相談室<br>
